<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta http-equiv="X-UA-Compatible" content="IE=edge">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Support Pidev ðŸŽ‰</title>
  <meta name="description" content="Lite & useful mobile app" />
  <meta property="og:title" content="Support Pidev ðŸŽ‰" />
  <meta property="og:description" content="Lite & useful mobile app" />

  <style>
    * {
      box-sizing: border-box;
    }
    .mt-1 {
      margin-top: 1rem;
    }
    a {
      text-decoration: none;
    }
    html, body {
      padding: 0;
      margin: 0;
      font-size: 100%;
      font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto,
        Helvetica, Arial, sans-serif, 'Apple Color Emoji', 'Segoe UI Emoji',
        'Segoe UI Symbol';
    }
    html, body, .donate-page {
      width: 100%;
      min-height: 100vh;
      display: flex;
      align-items: center;
      justify-content: center;
      position: relative;
    }
    .donate-page-background {
      background-color: #f9f9f9;
      background-image: url("./images/background.png");
      no-repeat center;
      background-size: cover;
      filter: blur(1px);
      -webkit-filter: blur(1px);
      position: absolute;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
      z-index: -1;
    }
    .donate-card {
      width: 90%;
      padding: 24px;
      background: #ffffff;
      border-radius: 12px;
    }
    .donate-card-title {
      font-size: 1.25rem;
      margin: 0;
      text-align: center;
    }
    .donate-card-poster {
      width: 100%;
      height: auto;
    }
    .donate-button {
      display: flex;
      justify-content: center;
      width: 100%;
      border-radius: 24px;
      height: 48px;
      align-items: center;
      transition: all 0.15s ease-in-out;
    }
    .donate-button:hover {
      box-shadow: 0 5px 5px rgba(0,0,0,0.3);
    }
    .donate-button.paypal {
      background: #f7f7f7;
    }
    .donate-button.paypal img {
      height: 25px;
    }
    .donate-button.buymeacoffee {
      background: #ffdd00;
    }
    .donate-button.donate-button.buymeacoffee svg {
      height: 48px;
    }
    .donate-button.momo {
      background: #b0006d;
    }
    .donate-button.momo svg {
      background: #b0006d;
      padding: 5px;
      height: 38px;
    }
    .donate-method-label {
      display: flex;
      background: #f8f8f8;
      height: 2px;
      position: relative;
      justify-content: center;
      margin-top: 1.5rem;
      margin-bottom: 1.5rem;
    }
    .donate-method-label span {
      background: #ffffff;
      position: absolute;
      top: -10px;
      color: #333333;
      font-size: 0.9rem;
      text-align: center;
      padding: 0 1rem;
    }
    .ref-link {
      display:inline-block;
      color:#333333;
      padding-left: 1rem;
      transition: all 0.15s ease-in-out;
    }
    .ref-link:hover {
      color: #617efc;
    }
    @media screen and (min-width: 600px) {
      .donate-card {
        max-width: 500px;
      }
      .donate-card-title {
        font-size: 1.5rem;
      }
    }
  </style>
</head>
